declare class math {
    

    static size(Array: any): any;
    static range(x: any, y: any): any;
    static subset(Array: any, x: number): any;
    static index(x: any, y?: any): any;
    static concat(x: any, y: any): any;
    static squeeze(x: any): any;
    static flatten(x: any): any;
    static multiply(x: any, y: any): any;
    static subtract(x: any, y: any): any;

}